import React, {Component} from 'react';

class Header extends Component {
  render(){
    return (
      <div>
        <h2>Makanan Khas Indonesia</h2>
      </div>
    );
  }
}

function App() {
  return (
    <div  >
      <h1>Rendering Elements</h1>
      <Header/>
    </div>
  );
}
export default App;
